import React, { useState, useEffect } from 'react';
import axios from 'axios';

function App() {
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState(null);

  useEffect(() => {
    // Try to fetch data from your backend
    axios.get('/api/health')
      .then(response => {
        console.log('Backend is running:', response.data);
        setLoading(false);
      })
      .catch(err => {
        console.error('Backend not running:', err);
        setError('Backend server not running');
        setLoading(false);
      });
  }, []);

  if (loading) {
    return (
      <div className="App">
        <header className="App-header">
          <h1>Loading...</h1>
        </header>
      </div>
    );
  }

  if (error) {
    return (
      <div className="App">
        <header className="App-header">
          <h1>Error: {error}</h1>
        </header>
      </div>
    );
  }

  return (
    <div className="App">
      <header className="App-header">
        <h1>Progrify</h1>
        <p>Welcome to Progrify!</p>
      </header>
    </div>
  );
}

export default App;
